import React, { useContext } from 'react';
import { GlobalContext } from '../context/Globalstate';
export const TransactionList = () => {

    const {transactions } = useContext(GlobalContext);



    return (
        <>
            <h3>History</h3>
            <ul className="list">
                {context.transactions.map(tran => (
                    <li className="minus">
                        {context.transaction.text} <span>-$400</span><button className="delete-btn">x</button>
                    </li>
                ))}
            </ul>
        </>
    )
}
